import * as React from 'react';
import { useTheme } from '@mui/material/styles';
import { LineChart, AreaChart, Area, Tooltip, XAxis, YAxis, Label, ResponsiveContainer } from 'recharts';
import Title from './Title';

import axios from 'axios';
const rangeData = [
    {
      "time": "00:00",
      "temp1": [
        0, 26.5
      ],
      "temp2": [
        0, 23.0
      ]

    },
    {
      "time": "03:00",
      "temp1": [
        0, 25.7
      ],
      "temp2": [
        0, 24.0
      ]
    },
    {
      "time": "05:00",
      "temp1": [
        0, 23.0
      ],
      "temp2": [
        0, 22.0
      ]
    },
    {
      "time": "07:00",
      "temperature": [
        26.5, 24.7
      ]
    }
  ]
  
function Chart() {
    const theme = useTheme();
}

class Test extends Node {
  constructor(props){
    super(props)
    this.state={
      append_FPList:undefined
    }
  }

  f1 = ()=>{
    axios.get('https://api/formerData/temperature',{})
    .then((res)=>{
      console.log(res.data.entry);
      this.setState({append_FPList:res.data.entry})
      })
  }
  render() {
    return (
      <div>
        <h1>Temperature 이전 데이터 확인</h1>
        <button onClick={this.f1}>버튼</button>
        <ResponsiveContainer>
          <AreaChart
            data={rangeData}
            margin={{
              top: 16,
              right: 16,
              bottom: 0,
              left: 24,
            }}
          >
            <XAxis
              dataKey="time"
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            />
            <YAxis
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            >
              <Label
                angle={270}
                position="left"
                style={{
                  textAnchor: 'middle',
                  fill: theme.palette.text.primary,
                  ...theme.typography.body1,
                }}
              >
                Temperature

              </Label>
            </YAxis>
            <Area dataKey="temp1" stroke="#8884d8" fill="#8884d8" />
            <Area dataKey="temp2" stroke="#8884d8" fill="yellow" />
            <Tooltip />
          </AreaChart>
        </ResponsiveContainer>
      </div>
    );
  }
}
export default Test;
